import { makeStyles } from '@material-ui/core'
import React from 'react'
import TextFieldComp from './TextFieldComp'

function FormDiv(props) {
    const useStyles = makeStyles(theme => ({
        title: {
            ...theme.typography.content,
            textAlign: 'center',
            fontSize: '2.5rem',
            marginTop: '20px'
        },
        formDiv: {
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            height: 'auto',
            width: '400px',
            backgroundColor: theme.palette.secondary.light,
            marginTop: '30px',
            marginBottom: '30px',
            borderRadius: '15px',
            flexDirection: 'column',
            paddingTop: '50px',
            paddingBottom: '50px',
        },
        label: {
            ...theme.typography.title,
            fontSize: '1.5rem'
        },
        btn: {
            ...theme.buttonDef
        },
        btnser: {
            ...theme.buttonDef,
            marginLeft: 'auto',
            marginRight: '20px'
        },
        btnLeft: {
            poaition: 'relative',
            marginRight: 'auto',
            marginLeft: '20px'
        }
    }))
    const classes = useStyles()

    return (
        <div>
            {props.data.map(item => {
                return (
                    <TextFieldComp
                        class={classes.label}
                        vaue={item.value}
                        name={item.name}
                        placeholder={item.placeholder}
                    />
                )
            })}
        </div>
    )
}

export default FormDiv
